import React, { useState } from "react";

const SearchBar = ({ setSearchQuery }) => {
  return (
    <input
      type="text"
      className="border p-2 w-full"
      placeholder="Search ingredients..."
      onChange={(e) => setSearchQuery(e.target.value)}
    />
  );
};

export default SearchBar;
